		[Language.Fr]: [
			'Les plumes de ses ailes lui servent de flèches.\nSa précision au tir est si grande qu’il peut\natteindre un gravillon à 100 m.',
			'Malgré sa grande vigilance et son air posé,\nil a tendance à céder à la panique dès qu’il est\npris de court.',
			'Les plumes de ses ailes lui servent de flèches.\nQuand il doit à tout prix toucher sa cible, il tire\nsur les lianes de son cou pour se concentrer.',
			'Il est capable de décocher ses plumes sur\nson ennemi en un dixième de seconde,\ns’assurant ainsi la victoire en un clin d’œil.',
			'Il décoche les plumes acérées de ses ailes\ncomme des flèches. Il ne rate jamais sa cible.',
			'Il décoche ses plumes acérées en un dixième\nde seconde. Sa victime n’a pas le temps de\nle voir agir qu’elle est déjà grièvement touchée.',
		],
		[Language.De]: [
			'Dieses Pokémon kann die Federn seiner Flügel\nwie Pfeile verschießen. Dabei ist es so präzise,\ndass es einen Kiesel auf 100 m durchbohrt.',
			'Im Grunde ein vorsichtiges und gelassenes\nPokémon, das jedoch in wahnsinnige Panik\nverfällt, wenn es überrascht wird.',
			'Es legt seine Federpfeile an, um sie auf Gegner\nzu schießen. Muss ein Schuss sitzen, zieht es\nzur Konzentration an einer seiner Kopfranken.',
			'Es braucht bloß 0,1 Sekunden, um eine Feder\nanzulegen und auf den Gegner zu schießen.\nOft besiegt es einen, bevor man blinzeln kann.',
			'Dieses Pokémon kann die Federn seiner Flügel\nwie Pfeile abschießen. Hat es sein Ziel angepeilt,\ntrifft es garantiert.',
			'In 0,1 Sekunden spannt es eine Feder in seine\nFlügelranke und schießt sie wie einen Pfeil auf\ndie Schwachstellen seines ahnungslosen Ziels.',
		],
		[Language.Es]: [
			'Las plumas de sus alas le sirven de flechas con\nlas que puede acertar a un guijarro a 100 m.',
			'Aunque es extremadamente cauteloso y\ncalmado por naturaleza, si lo pillan por\nsorpresa, el pánico se apodera de él.',
			'Usa sus plumas como flechas para atacar a los\nrivales. Si no puede permitirse fallar, frunce su\ncapucha para concentrarse mejor.',
			'Tan solo le lleva una décima de segundo sacar\nuna pluma y disparar al rival, y muchas veces\ngana el combate en un abrir y cerrar de ojos.',
			'Usa sus plumas como flechas para atacar a los\nrivales. Una vez que ha fijado el blanco, no falla\njamás.',
			'Tan solo le lleva una décima de segundo sacar\nuna pluma y disparar al rival, a quien acierta en\nun punto vital antes de que pueda darse cuenta.',
		],
		[Language.It]: [
			'Scocca piume dalle sue ali come se fossero\nfrecce. È preciso al punto da riuscire a centrare\nuna piccola pietra a 100 m di distanza.',
			'In genere è molto cauto e misurato, ma nei rari\ncasi in cui viene colto di sorpresa si lascia\nfacilmente prendere dal panico.',
			'Scocca piume come fossero frecce. Quando non\ndeve mancare il bersaglio, tira le liane del\ncappuccio per ridurne l’apertura e mirare meglio.',
			'È in grado di scoccare piume e colpire il nemico\nin un decimo di secondo, aggiudicandosi la\nvittoria in un batter d’occhio.',
			'Scocca piume dalle sue ali come fossero frecce\nlanciate da un arco. Una volta presa la mira,\nnon manca mai il bersaglio.',
			'Può preparare e scoccare una delle sue piume\naffilate in 0,1 secondi. Trafigge l’avversario\nnei suoi punti vitali prima che se ne accorga.',
		],
		[Language.En]: [
			'It fires arrow quills from its wings with such\nprecision, they can pierce a pebble at distances\nover a hundred yards.',
			'Although basically cool and cautious, when it’s\ncaught by surprise, it’s seized by panic.',
			'It nocks its arrow quills and shoots them at\nopponents. When it simply can’t afford to miss,\nit tugs the vine on its head to improve its focus.',
			'Decidueye can nock and fire an arrow at an\nenemy in a tenth of a second, so its battles are\ndecided in the blink of an eye.',
			'As if wielding a bow, it launches the arrow quills\nhidden among the feathers of its wings.\nDecidueye’s shots never miss.',
			'In a tenth of a second, it can nock and fire an\narrow quill, piercing an opponent’s weak point\nbefore they notice what’s happening.',
			"The air stored inside the rachises of Decidueye's feathers\ninsulates the Pokémon against Hisui's extreme cold. This is\nfirm proof that evolution can be influenced by environment.",
		],
		[Language.Ja]: [
			'翼に　仕込まれた　矢羽を\n番えて放つ。　１００メートル先の\n小石も　貫く　精度。',
			'基本的に　用心深く\nクールだが　不意を　つかれると\n大パニックに　陥ってしまう。',
			'矢羽を　つがえ　相手に　放つ。\n絶対　外せない時は　頭の\nツルを引き　集中　するのだ。',
			'わずか　０．１秒で　ハネを\n番えて　敵を　撃つ。　瞬きの\n間に　勝負が　ついている。',
			'翼に　仕込まれた　矢羽根を\n弓矢のように　つがえて　放つ。\n狙った　的は　外さない。',
			'０．１秒で　矢羽根を　翼の\n蔓に　つがえて　放つ。　相手が\n気づく前に　急所を　射貫く。',
		],
		[Language.ZhHans]: [
			'搭弦射出收藏在翅膀里的箭羽。\n有着连前方１００米的小石头\n也能穿透的精度。',
			'基本上是十分谨慎且冷静的，\n但如果被冷不防地袭击了，\n就会陷入巨大的恐慌中。',
			'会搭上箭羽射向对手。\n在绝对不想射偏时，\n会拉紧头上的藤蔓集中精神。',
			'仅用０.１秒就能搭上羽毛，\n向敌人射击。\n在一瞬之间决出胜负。',
			'会像射箭那样射出\n藏在自己翅膀里的箭羽。\n只要瞄准目标就绝不会射偏。',
			'只要０.１秒就可以在翅膀的\n藤蔓上搭好箭羽、射向敌人，\n并在敌人发现前贯穿其要害。',
		],
